const MainCoins = () => (
	<div className='main-coins'>
		{Array.from({ length: 5 }, (_, index) => (
			<div key={index} className='active' id={`coin-${index}`}>
				<img
					src={
						require('../../../../assets/pictures/coins/silver/coin_front.svg')
							.default
					}
					alt={`Silver coin ${index + 1}`}
				/>
			</div>
		))}
	</div>
)

export default MainCoins
